import React, { useEffect, useState } from "react";
import Papa from "papaparse";

import LineChart from "./Components/LineChart";
import DonutChart from "./Components/DonutChart";
import "./App.css"; // Optional for layout styling
import {
  Chart as ChartJS,
  LineElement,
  PointElement,
  ArcElement,
  BarElement,
  CategoryScale,
  LinearScale,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  LineElement,
  PointElement,
  ArcElement,
  BarElement,
  CategoryScale,
  LinearScale,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    Papa.parse("/food.csv", {
      header: true,
      download: true,
      complete: (results) => {
        const clean = results.data
          .filter(d => d.VALUE && !isNaN(parseFloat(d.VALUE)))
          .map(d => ({
            ...d,
            VALUE: parseFloat(d.VALUE)
          }));
        setData(clean);
      }
    });
  }, []);

  return (
    <div className="dashboard">
      <h1 className="dashboard-title">Food Price Dashboard</h1>
      <div className="charts-row">
        <LineChart data={data} />
        <DonutChart data={data} />
      </div>
    </div>
  );
}

export default App;
